n\r\n　　本周期，环渤海港口动力煤规格品成交价格区间稳中有涨，涨幅在5元/吨左右。其中，秦皇岛港5000大卡动力煤价格为505-515元/吨，5500大卡动力煤价格为575-585元/吨，5800大卡发热量动力煤价格为600-610元/吨，均与上期持平；4500大卡','2019-07-03 15:01:32','1',3),(18,2,'进口煤价格低到不可想象！','本期看点','2019-06-27 09:35:54','0',2),(19,3,'(03月11日)四大煤种最新走势','〈动力煤市场〉','2019-06-27 09:36:32','0',3),(20,4,'动力煤市场将持稳运行','国内动力煤现货市场继续上涨，由于需求端抵触和观望情绪增强，港口现货报价涨幅有所收窄。陕西榆林地区复产情况缓慢，在产煤矿供不应求，内蒙古鄂尔多斯地区优质煤源紧缺，销售良好，煤价频繁提涨。电厂库存仍然偏高位，目前仍以长协拉运为主，补库需求暂时不大，预计动力煤市场将持稳运行。','2019-06-27 09:37:39','0',3),(21,2,'今年1月份策克口岸进口煤炭同比下降14.09%','策克口岸位于内蒙古阿拉善盟额济纳旗境内，在新疆老爷庙口岸与内蒙古甘','2019-07-03 15:01:33','1',2),(22,9,'(03月07日)环渤海动力煤价报收578元/吨','本报告期（2019年2月27日至2019年3月5日），环渤海动力煤价格指数报收于578元/吨，环比上行3元/吨。','2019-06-27 09:38:45','0',6),(23,2,'3月份国内煤炭市场或将出现上下游博弈行情！','2月份，动力煤市场震荡运行，焦煤市场稳中向好。具体来看：2月份受春节假期影响，市场整体运行平稳居多,节前煤炭市场持稳运行，春节过后，受供应收缩预期叠加下游开工补库需求释放，动力煤、焦煤市场均有所上涨，北方港口动力煤价格上涨后销售压力渐增，价格再次弱势回调。','2019-07-03 15:01:35','1',2),(24,1,'动力煤市场小幅震荡 焦煤价格支撑较足','节后煤炭市场复工节奏加快，部分地方矿陆续出煤。此外，随着天气的回暖以及冬季运输掣肘的过去，消费地缺煤的现象得到了缓解，同时叠加需求面的走弱情绪，动力煤年后坚挺态势不复存在，市场小幅震荡。','2019-06-27 09:40:15','0',3),(25,2,'3月神华月度长协价','2019年3月神华月度长协价格，（相比2019年2月28日前）：','2019-06-27 09:40:45','0',2),(26,2,'澳煤事故对我国焦煤影响几何？','2019年开始后，黑色系品种成为市场上最引人关注的品种。先是淡水河谷溃坝事件引起铁矿石疯涨，黑色系跟随集体上涨，后进口焦煤的限制政策又引得各方关注。2月20日晚，澳洲煤矿Anglo因突发事故造成停产检查，使得20日焦煤期货合约夜盘大幅高开，随后21日全天焦煤期货合约高位振荡，截至收盘，焦煤1905合约期货价格为1285元/吨，与上午开盘价基本持平。此次事故对我国焦煤市场是否有影响？','2019-07-03 15:01:36','1',4),(27,9,'煤炭行业：需求持续回暖重点关注煤矿复产进度','六大电日耗开始逐步恢复， 19 日开始已经提升到 50 万吨以上。本周沿海六大电日耗均值为 54.3 万吨，较上周的 45.7 万吨增加 8.5 万吨，增幅 18.7%，较 18年同期的 42.1 万吨增加 12.2 万吨，增幅 28.9%； 2 月 20 日六大电日耗为 58.7 万吨，周环比增加 12.6 万吨，增幅 27.3%，同比增加 16.8 万吨，增幅 40.1%，可用天数为 29.0 天，较上周同期下降 8.5 天，较去年同期增加 6.1 天。最新一期重点电厂日均耗煤 340.7 万吨，较上','2019-06-27 09:42:06','0',2),(28,3,'内蒙古动力煤：坑口煤价稳中下行 港口煤价涨幅收窄','内蒙古讯：近期内蒙古地区煤矿继续处于复产复工状态当中，市场交投活跃度极低，销售情况一般；坑口方面，煤炭生产继续复工，生产和销售水平逐步恢复，近日产地因降雪等因素影响，煤炭外销不佳，加之贸易商节后采购不积极，大部分煤矿稳中下调煤价，块煤降幅大于沫煤，矿方对后市略显悲观，现坑口CV5500坑口含税价365元/吨左右；港口方面，现货市场变化不大，市场询盘仍较积极，主要是水泥、化工等市场需求，但高价成交有限，煤价上涨有所收窄，多以观望为主，目前港口CV5500主流报价610元/吨左右，CV5000主流报价535元','2019-06-27 09:42:28','0',2),(29,4,'因海关通关延迟 中国贸易商缩减澳煤进口','2月18日，有贸易商表示，因在中国海关通关时间至少倍增至40天，中国煤炭贸易商正在暂停采购澳洲煤炭。\r\n\r\n这些贸易商表示，只有澳大利亚的煤船受到影响。澳大利亚是中国最大的煤炭供应国。\r\n\r\n“我们已经停止向澳大利亚下单采购煤炭，因为不知道限制措施将会维持多久。”一上海贸易公司经理表示，该公司通常每个月采购约40万吨澳大利亚煤炭。\r\n\r\n通常情况下，海关通关所需时间为5-20天。该名经理称，当前通关时间可能长达45天。\r\n\r\n目前尚不清楚为何中国加强对澳大利亚商品的进口审查，但最近几个月网络安全以及中国对','2019-07-03 15:01:37','1',1),(30,2,'中国贸易商缩减澳煤进口','2月18日，有贸易商表示，因在中国海关通关时间至少倍增至40天，中国煤炭贸易商正在暂停采购澳洲煤炭。','2019-06-27 09:43:42','0',2),(31,2,'本周港口煤价先涨后跌','年后，受煤炭交易活跃度提升，环渤海港口场存回落，优质煤出现紧缺等因素影响，贸易商和煤企纷纷捂货惜售，市场煤价格出现上涨。截止15日，秦皇岛港5500大卡市场动力煤实际交易价格已经升至605元/吨。笔者预计，此轮煤价将涨至本周二或者本周三，涨至620-630元/吨；随后，价格将出现回落','2019-06-27 09:44:11','0',4),(32,9,'动力煤市场多空分歧大','根据评估，仅榆林地区一季度影响产量大约在1500万吨-1800万吨，加之超产及扩展到整个陕西地区，一季度影响产量不低于2000万吨。但是往库存一端考虑，实际影响就小很多。首先从电厂角度看，重点电厂近期库存在7800万吨，加上节日因素，春节后库存大约在8000万吨以上，较之历年同比高出1500万吨左右，考虑到电厂高库存策略的基数提高效应，实际库存同比在500万吨-1000万吨左右，而重点电厂装机容量占全国火电装机比例为49.3％，实际全国库存同比大约高出1000万吨-2000万吨。因此电厂自身库存的蓄水池功','2019-06-27 09:44:37','0',2),(33,4,'去年中国水电新增生产能力859万千瓦，为2003年以来最低水',' 中国矿业大学教授葛世荣近日在《中国矿业大学学报》发表了题为《深部煤炭化学开采技术》的论文。\n\n','2019-07-03 15:01:40','1',-1),(34,4,'动力煤市场小幅震荡 焦煤价格支撑较足','节后煤炭市场复工节奏加快，部分地方矿陆续出煤。此外，随着天气的回暖以及冬季运输掣肘的过去，消费地缺煤的现象得到了缓解，同时叠加需求面的走弱情绪，动力煤年后坚挺态势不复存在，市场小幅震荡。','2019-07-02 12:31:16','0',-1),(85,1,'澳煤事故对我国焦煤影响几何？0','2019年开始后，黑色系品种成为市场上最引人关注的品种。先是淡水河谷溃坝事件引起铁矿石疯涨，黑色系跟随集体上涨，后进口焦煤的限制政策又引得各方关注。2月20日晚，澳洲煤矿Anglo因突发事故造成停产检查，使得20日焦煤期货合约夜盘大幅高开，随后21日全天焦煤期货合约高位振荡，截至收盘，焦煤1905合约期货价格为1285元/吨，与上午开盘价基本持平。此次事故对我国焦煤市场是否有影响？','2019-07-02 16:10:34','1',1),(86,1,'澳煤事故对我国焦煤影响几何？1','2019年开始后，黑色系品种成为市场上最引人关注的品种。先是淡水河谷溃坝事件引起铁矿石疯涨，黑色系跟随集体上涨，后进口焦煤的限制政策又引得各方关注。2月20日晚，澳洲煤矿Anglo因突发事故造成停产检查，使得20日焦煤期货合约夜盘大幅高开，随后21日全天焦煤期货合约高位振荡，截至收盘，焦煤1905合约期货价格为1285元/吨，与上午开盘价基本持平。此次事故对我国焦煤市场是否有影响？','2019-07-02 16:10:34','1',1),(87,1,'澳煤事故对我国焦煤影响几何？2','2019年开始后，黑色系品种成为市场上最引人关注的品种。先是淡水河谷溃坝事件引起铁矿石疯涨，黑色系跟随集体上涨，后进口焦煤的限制政策又引得各方关注。2月20日晚，澳洲煤矿Anglo因突发事故造成停产检查，使得20日焦煤期货合约夜盘大幅高开，随后21日全天焦煤期货合约高位振荡，截至收盘，焦煤1905合约期货价格为1285元/吨，与上午开盘价基本持平。此次事故对我国焦煤市场是否有影响？','2019-07-02 16:10:34','1',1),(88,1,'澳煤事故对我国焦煤影响几何？3','2019年开始后，黑色系品种成为市场上最引人关注的品