/*Table structure for table `tb_opinion` */

DROP TABLE IF EXISTS `tb_opinion`;

CREATE TABLE `tb_opinion` (
  `oID` int(11) NOT NULL AUTO_INCREMENT COMMENT '意见编号',
  `uID` int(11) NOT NULL COMMENT '编号',
  `uOpinion` varchar(200) NOT NULL COMMENT '审核意见',
  `oType` varchar(2) NOT NULL COMMENT '意见类型（1.用户审核 2.买方挂牌审核 3.卖方挂牌审核 4.资讯审核）',
  PRIMARY KEY (`oID`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='审核意见表';

