/*Table structure for table `tb_order_info` */

DROP TABLE IF EXISTS `tb_order_info`;

CREATE TABLE `tb_order_info` (
  `orderNo` varchar(20) NOT NULL COMMENT '订单编号',
  `tradeNo` varchar(20) NOT NULL COMMENT '交易编号',
  `orderState` varchar(2) NOT NULL DEFAULT '0' COMMENT '订单状态(0 待付款，1 待发货，2 已发货，3 确认收货)',
  `orderDate` datetime NOT NULL COMMENT '订单日期',
  `receiveDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '收货日期',
  PRIMARY KEY (`orderNo`)
