/*Table structure for table `tb_purch_info` */

DROP TABLE IF EXISTS `tb_purch_info`;

CREATE TABLE `tb_purch_info` (
  `pNumber` int(11) NOT NULL AUTO_INCREMENT COMMENT '挂牌编号',
  `pListID` varchar(50) NOT NULL COMMENT '单据编号',
  `pName` varchar(20) NOT NULL COMMENT '申请人',
  `pIssuer` varchar(20) NOT NULL COMMENT '签发人',
  `pApplyDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '申请日期',
  `pDeliverEarliest` datetime NOT NULL COMMENT '最早交货时间',
  `pDeliverLatest` datetime NOT NULL COMMENT '最晚交货时间',
  `pCoalType` varchar(20) NOT NULL COMMENT '煤炭分类',
  `pCoalBusType` varchar(20) NOT NULL COMMENT '商业分类',
  `pCount` double NOT NULL COMMENT '采购数量',
  `pTransport` varchar(20) NOT NULL COMMENT '运输方式',
  `coalPrice` double NOT NULL COMMENT '原煤单价（新增）',
  `transPrice` double NOT NULL COMMENT '运费单价（新增）',
  `pDeliverPlace` varchar(20) NOT NULL COMMENT '交货地点',
  `pSettlement` varchar(20) NOT NULL COMMENT '结算方式',
  `pCheck` varchar(20) NOT NULL COMMENT '验收方式',
  `pPayment` varchar(100) NOT NULL COMMENT '结算付款方式',
  `pQuoDeposit` double DEFAULT NULL COMMENT '报价保证金缴纳',
  `pBidBond` double DEFAULT NULL COMMENT '履约保证金缴纳',
  `pQnetar` double NOT NULL COMMENT '收到基低位发热量最小值(Kcal/kg)',
  `pStar` double NOT NULL COMMENT '收到基全硫(%)',
  `pM` double NOT NULL COMMENT '全水分最大值(%)',
  `pAar` double NOT NULL COMMENT '收到基灰分最大值(%)',
  `pVarmin` double NOT NULL COMMENT '收到基挥发分最小值(%)',
  `pVarmax` double NOT NULL COMMENT '收到基挥发分最大值(%)',
  `pMad` double NOT NULL COMMENT '空干基水分最大值(%)',
  `pStad` double NOT NULL COMMENT '空干基全硫最大值(%)',
  `pVadmin` double NOT NULL COMMENT '空干基挥发分最小值(%)',
  `pVadmax` double NOT NULL COMMENT '空干基挥发分最大值(%)',
  `pQgrd` double NOT NULL COMMENT '干基高位发热量最小值(Kcal/kg)',
  `pStd` double NOT NULL COMMENT '干基全硫最大值(%)',
  `pVanmin` double NOT NULL COMMENT '干燥无灰基挥发分最小值(%)',
  `pVanmax` double NOT NULL COMMENT '干燥无灰基挥发分最大值(%)',
  `pGrad` double NOT NULL COMMENT '粒度最大值(mm)',
  `pST` double NOT NULL COMMENT '灰熔点最小值(℃)',
  `pHGI` double NOT NULL COMMENT '哈氏可磨系数最小值',
  `pRemarks` varchar(100) NOT NULL COMMENT '备注',
  `pState` varchar(2) NOT NULL DEFAULT '0' COMMENT '挂牌审核状态，默认为0(待审核），1代表已发布，2代表已下架 3代表待修改',
  `uID` int(11) NOT NULL COMMENT '用户编号',
  `adminID` int(11) NOT NULL DEFAULT '-1' COMMENT '挂牌审核管理员编号',
  `sPlace` varchar(20) NOT NULL DEFAULT '山西' COMMENT '货源地（新增）',
  `exchangeMeans` varchar(10) NOT NULL DEFAULT '线下交易' COMMENT '交易方式（新增）',
  `logisticsbus` varchar(10) NOT NULL DEFAULT '邮政' COMMENT '物流商（新增）',
  PRIMARY KEY (`pNumber`)
