  `uID` int(11) NOT NULL COMMENT '用户编号',
  PRIMARY KEY (`cQuestionID`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='密保问题表';

