/*Table structure for table `tb_seller_info` */

DROP TABLE IF EXISTS `tb_seller_info`;

CREATE TABLE `tb_seller_info` (
  `sNumber` int(11) NOT NULL AUTO_INCREMENT COMMENT '挂牌编号',
  `coalTtype` varchar(10) NOT NULL COMMENT '煤种（新增）',
  `transType` varchar(10) NOT NULL COMMENT '运输方式（新增）',
  `sCount` double NOT NULL COMMENT '供应数量（万吨）',
  `sKCal` double NOT NULL COMMENT '热值(KCal/kg)',
  `sCPrice` double NOT NULL COMMENT '原煤单价(元/吨)',
  `sS` double NOT NULL COMMENT '全硫含量最大值(%)',
  `sPlace` varchar(20) NOT NULL COMMENT '产地',
  `sFreight` double NOT NULL COMMENT '运费单价(元/吨)',
  `sVolatilizeMin` double NOT NULL COMMENT '挥发分最小值',
  `sVolatilizeMax` double NOT NULL COMMENT '挥发分最大值',
  `sDeliverPlace` varchar(20) NOT NULL COMMENT '发货地',
  `sAshContent` double NOT NULL COMMENT '空干基灰分最大值(%)',
  `sMoisture` double NOT NULL COMMENT '全水分最大值(%)',
  `sState` varchar(2) NOT NULL DEFAULT '0' COMMENT '挂牌审核状态，默认为0(待审核），1代表已发布，2代表已下架 3代表待修改',
  `uID` int(11) NOT NULL COMMENT '用户编号',
  `adminID` int(11) NOT NULL DEFAULT '-1' COMMENT '挂牌审核管理员编号',
  `deliveryPlace` varchar(20) NOT NULL DEFAULT '西安' COMMENT '到货地（新增）',
  `exchangeMeans` varchar(10) NOT NULL DEFAULT '线下交易' COMMENT '交易方式（新增）',
  `logisticsbus` varchar(10) NOT NULL DEFAULT '邮政' COMMENT '物流商（新增）',
  PRIMARY KEY (`sNumber`)
