/*Table structure for table `tb_trade_account` */

DROP TABLE IF EXISTS `tb_trade_account`;

CREATE TABLE `tb_trade_account` (
  `uID` int(11) NOT NULL AUTO_INCREMENT COMMENT '用户编号',
  `uRealName` varchar(20) NOT NULL COMMENT '联系人',
  `uTelephone` varchar(14) NOT NULL COMMENT '联系电话',
  `muName` varchar(20) NOT NULL COMMENT '财务人员姓名 ',
  `muTelephone` varchar(14) NOT NULL COMMENT '财务人员电话',
  `muMail` varchar(20) NOT NULL COMMENT '财务人员邮箱',
  `cName` varchar(50) NOT NULL COMMENT '供应商名称',
  `cType` varchar(10) NOT NULL COMMENT '企业类型',
  `cLegalPerson` varchar(20) NOT NULL COMMENT '法人代表',
  `cLegalPersonID` varchar(18) NOT NULL COMMENT '法人身份证',
  `cAddress` varchar(50) NOT NULL COMMENT '注册地区',
  `cEmile` varchar(20) NOT NULL COMMENT '企业邮箱',
  `cEasyName` varchar(20) DEFAULT NULL COMMENT '企业简称',
  `cFax` varchar(12) DEFAULT NULL COMMENT '企业传真',
  `cMoney` double NOT NULL COMMENT '注册资金',
  `cBusinessLicense` varchar(50) NOT NULL COMMENT '企业营业执照号',
  `cTax` varchar(50) NOT NULL COMMENT '企业税务登记号',
  `cOrg` varchar(50) NOT NULL COMMENT '企业组织机构代码证号',
  `cBank` varchar(20) NOT NULL COMMENT '企业开户银行',
  `cBankAccount` varchar(19) NOT NULL COMMENT '企业开户行账户',
  `cPermission` varchar(50) NOT NULL COMMENT '煤炭经营许可证号',
  `cResource` varchar(200) NOT NULL COMMENT '可控煤炭资源(煤源，储煤场地)情况(数量、质量）',
  `cTransport` varchar(50) NOT NULL COMMENT '运输保障能力',
  `cBrief` varchar(100) NOT NULL COMMENT '供应商简介',
  `cPostalCode` varchar(6) NOT NULL COMMENT '邮政编码',
  `uState` varchar(2) NOT NULL DEFAULT '1' COMMENT '审核状态(1:只注册了第一步.2:完整信息待审核.3:已通过审核)',
  PRIMARY KEY (`uID`)
