/*Table structure for table `tb_transaction` */

DROP TABLE IF EXISTS `tb_transaction`;

CREATE TABLE `tb_transaction` (
  `tradeNo` varchar(20) NOT NULL COMMENT '交易编号',
  `delistNo` int(11) NOT NULL COMMENT '摘牌编号(交易人员信息表的用户编号)',
  `listNo` int(11) NOT NULL COMMENT '挂牌编号(挂牌信息表中的主键)',
  `contract` varchar(50) NOT NULL COMMENT '合同内容(文件名称)',
  `contractState` varchar(2) NOT NULL DEFAULT '0' COMMENT '合同状态（00为没上传，01为挂牌方确认，10为摘牌方确认，11为均确认',
  `receipt` varchar(50) NOT NULL DEFAULT '.jpg' COMMENT '回执单',
  `receiptState` varchar(2) NOT NULL DEFAULT '0' COMMENT '回执单状态（0 未上传，1 上传未确认，2 已确认）',
  `source` varchar(2) NOT NULL DEFAULT '1' COMMENT '挂牌来源(1 卖方挂牌，2 买方挂牌)',
  PRIMARY KEY (`tradeNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='交易信息表';

