/*!50001 DROP TABLE IF EXISTS `view_order_details_seller` */;

/*!50001 CREATE TABLE  `view_order_details_seller`(
 `orderNo` varchar(20) NOT NULL ,
 `sellerName` varchar(50) NOT NULL ,
 `sellerTele` varchar(14) NOT NULL ,
 `purchName` varchar(50) NOT NULL ,
 `purchTele` varchar(14) NOT NULL ,
 `coalType` varchar(10) NOT NULL ,
 `quantity` double NOT NULL ,
 `money` double NOT NULL  default '0' ,
 `salePlace` varchar(20) NOT NULL ,
 `deliveryPlace` varchar(20) NOT NULL  default '西安' ,
 `orderDate` datetime NOT NULL ,
 `receiveDate` timestamp NOT NULL  default '0000-00-00 00:00:00' ,
 `exchangeMeans` varchar(10) NOT NULL  default '线下交易' ,
 `orderState` varchar(2) NOT NULL  default '0' 
)*/;

/*View structure for view view_order_details_purch */

/*!50001 DROP TABLE IF EXISTS `view_order_details_purch` */;
/*!50001 DROP VIEW IF EXISTS `view_order_details_purch` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_order_details_purch` AS (select `o`.`orderNo` AS `orderNo`,`t2`.`cName` AS `sellerName`,`t2`.`uTelephone` AS `sellerTele`,`t1`.`cName` AS `purchName`,`t1`.`uTelephone` AS `purchTele`,`p`.`pCoalType` AS `coalType`,`p`.`pCount` AS `quantity`,((`p`.`coalPrice` + `p`.`transPrice`) * `p`.`pCount`) AS `money`,`p`.`sPlace` AS `salePlace`,`p`.`pDeliverPlace` AS `deliveryPlace`,`o`.`orderDate` AS `orderDate`,`o`.`receiveDate` AS `receiveDate`,`p`.`exchangeMeans` AS `exchangeMeans`,`o`.`orderState` AS `orderState` from ((((`tb_trade_account` `t1` join `tb_purch_info` `p`) join `tb_transaction` `t`) join `tb_order_info` `o`) join `tb_trade_account` `t2`) where ((`t`.`source` = '2') and (`t1`.`uID` = `p`.`uID`) and (`p`.`pNumber` = `t`.`listNo`) and (`t`.`delistNo` = `t2`.`uID`) and (`t`.`tradeNo` = `o`.`tradeNo`))) */;

/*View structure for view view_order_details_seller */

/*!50001 DROP TABLE IF EXISTS `view_order_details_seller` */;
/*!50001 DROP VIEW IF EXISTS `view_order_details_seller` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_order_details_seller` AS (select `o`.`orderNo` AS `orderNo`,`t1`.`cName` AS `sellerName`,`t1`.`uTelephone` AS `sellerTele`,`t2`.`cName` AS `purchName`,`t2`.`uTelephone` AS `purchTele`,`s`.`coalTtype` AS `coalType`,`s`.`sCount` AS `quantity`,((`s`.`sCPrice` + `s`.`sFreight`) * `s`.`sCount`) AS `money`,`s`.`sPlace` AS `salePlace`,`s`.`deliveryPlace` AS `deliveryPlace`,`o`.`orderDate` AS `orderDate`,`o`.`receiveDate` AS `receiveDate`,`s`.`exchangeMeans` AS `exchangeMeans`,`o`.`orderState` AS `orderState` from ((((`tb_trade_account` `t1` join `tb_seller_info` `s`) join `tb_transaction` `t`) join `tb_order_info` `o`) join `tb_trade_account` `t2`) where ((`t`.`source` = '1') and (`t1`.`uID` = `s`.`uID`) and (`s`.`sNumber` = `t`.`listNo`) and (`t`.`delistNo` = `t2`.`uID`) and (`t`.`tradeNo` = `o`.`tradeNo`))) */;

